import React, { useState } from 'react';
import { GluestackUIProvider, Box, Text, ScrollView, ButtonText } from '@gluestack-ui/themed';
import { Input, InputField, Button, FormControl, FormControlLabel, FormControlLabelText, FormControlHelper, FormControlHelperText, FormControlError, FormControlErrorIcon, FormControlErrorText, AlertCircleIcon } from '@gluestack-ui/themed';

export default function Login() {
  const [formData, setFormData] = useState({});
  const [errors, setErrors] = useState({});
  const regex_email = /[a-zA-Z0-9_]+([.][a-zA-Z0-9_]+)@[a-zA-Z0-9_]+([.][a-zA-Z0-9_]+)[.][a-zA-Z]{2,5}/;
  const digit = /[0-9]/;
  const upperCase = /[A-Z]/;
  const lowerCase = /[a-z]/;
  const nonAlphanumeric = /[^0-9A-Za-z]/;

  const isStrongPassword = (password) => [digit, upperCase, lowerCase, nonAlphanumeric].every(re => re.test(password)) && password.length >= 8 && password.length <= 32;

  const validate = () => {
    setErrors({});
    console.log('email', formData.email);
    console.log('password', formData.password);

    if (!regex_email.test(formData.email)) {
      setErrors({ ...errors, email: "El correo electrónico no es válido" });
      return false;
    }

    if (formData.email === undefined) {
      setErrors({ ...errors, email: "El correo electrónico es requerido" });
      return false;
    } else if (formData.email.length < 3) {
      setErrors({ ...errors, email: "El correo electrónico es demasiado corto" });
      return false;
    }

    if (!isStrongPassword(formData.password)) {
      setErrors({ ...errors, password: "La contraseña no es válida" });
      return false;
    }

    return true;
  };

  const onSubmit = () => {
    validate() ? console.log('Validación exitosa') : console.log('Validación fallida', errors);
  };

  return (
    <GluestackUIProvider config={config}>
      <Box flex={1} backgroundColor="$white">
        <ScrollView contentContainerStyle={{ flexGrow: 1 }}>
          <Box height="60%" justifyContent="space-between" alignItems="center">
            <Box justifyContent="center" alignItems="center">
              <Text>Logo</Text>
            </Box>
            <Box flexDirection="row">
              <Box>
                <FormControl isInvalid={false} size="lg" isDisabled={false} isRequired={true}>
                  <FormControlLabel>
                    <FormControlLabelText color="$white">Correo electrónico</FormControlLabelText>
                  </FormControlLabel>
                  <Input isFocused={false} $focus-borderColor="$purple500" backgroundColor="">
                    <InputField type="text" defaultValue="daniel@gmail.com" placeholder="Correo electrónico" onChangeText={(value) => setFormData({ ...formData, email: value })} />
                  </Input>

                  <FormControlHelper>
                    <FormControlHelperText>Debe tener al menos 6 caracteres.</FormControlHelperText>
                  </FormControlHelper>

                  <FormControlError>
                    <FormControlErrorIcon as={AlertCircleIcon} />
                    <FormControlErrorText>{errors.email}</FormControlErrorText>
                  </FormControlError>
                </FormControl>
              </Box>
              <Box>
                <FormControl isInvalid={false} size="lg" isDisabled={false} isRequired={false}>
                  <FormControlLabel>
                    <FormControlLabelText>Contraseña</FormControlLabelText>
                  </FormControlLabel>
                  <Input>
                    <InputField type="password" defaultValue="12345" placeholder="Contraseña" onChangeText={(value) => setFormData({ ...formData, password: value })} />
                  </Input>

                  <FormControlHelper>
                    <FormControlHelperText>Debe tener al menos 6 caracteres.</FormControlHelperText>
                  </FormControlHelper>

                  <FormControlError>
                    <FormControlErrorIcon as={AlertCircleIcon} />
                    <FormControlErrorText>{errors.password}</FormControlErrorText>
                  </FormControlError>
                </FormControl>
              </Box>
            </Box>
            <Button action="primary" variant="solid" size="md" isDisabled={false} onPress={onSubmit}>
              <ButtonText>Enviar</ButtonText>
            </Button>
          </Box>
        </ScrollView>
      </Box>
    </GluestackUIProvider>
  );
}
